import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import PersonIcon from '@material-ui/icons/Person';
import WorkIcon from '@material-ui/icons/Work';
import SchoolIcon from '@material-ui/icons/School';
import HobbiesIcon from '@material-ui/icons/Schedule';
import ForumIcon from '@material-ui/icons/Forum';
import Work from './work';
import {BrowserRouter as Router} from 'react-router-dom';

const useStyles = makeStyles({
  root: {
    width: '100%',
    paddingBottom: '16px',
    background: '#F0F0F0',
  },
});

export default function LabelBottomNavigation() {
  const classes = useStyles();
  const [value, setValue] = React.useState('recents');

  function handleChange(event, newValue) {
    setValue(newValue);
    console.log(newValue);
    if (newValue === "work"){
      <Work />
    }
  }

  return (
    <BottomNavigation value={value} onChange={handleChange} className={classes.root}>
      <BottomNavigationAction label="Work" value="work" icon={<WorkIcon />} children={Work} /> 
      <BottomNavigationAction label="Education" value="education" icon={<SchoolIcon />} />
      <BottomNavigationAction label="About" value="about" icon={<PersonIcon />} />
      <BottomNavigationAction label="Hobbies" value="hobbies" icon={<HobbiesIcon />} />
      <BottomNavigationAction label="Contact" value="contact" icon={<ForumIcon />} />


    </BottomNavigation>
  );
}
